import React, { useContext, useEffect ,useState} from 'react'
import { useNavigate } from 'react-router-dom';
import { LoginContext } from './ContextProvider/Context';
import CircularProgress from '@mui/material/CircularProgress';
import Box from '@mui/material/Box';

const OrdersPage = () => {
    return <h1>Orders Page</h1>
  }
  
  const FitnessPage = () => {
    return <h1>Fitness Page</h1>
  }
  
  const QrCodePage = () => {
    return <h1>QR Code Page</h1>
  }
  
  const ProfilePage = () => {
    return <h1>Profile Page</h1>
  }
  
  const Dashboard = () => {
    const { logindata, setLoginData } = useContext(LoginContext);
    const [data, setData] = useState(false);
    const history = useNavigate();
  
    const DashboardValid = async () => {
      let token = localStorage.getItem('usersdatatoken');
  
      const res = await fetch('/validuser', {
        method: 'GET',
        headers: {
          'Content-Type': 'application/json',
          Authorization: token,
        },
      });
  
      const data = await res.json();
  
      if (data.status == 401 || !data) {
        history('*');
      } else {
        console.log('user verify');
        setLoginData(data);
        history('/dash');
      }
    };
  
    useEffect(() => {
      setTimeout(() => {
        DashboardValid();
        setData(true);
      }, 2000);
    }, []);
  
    return (
      <div className="bg-gray-100 min-h-screen flex">
        <nav className="bg-white shadow w-64">
          <div className="max-w-7xl mx-auto px-2 sm:px-6 lg:px-8">
            <div className="relative flex flex-col items-start justify-start h-full">
              <NavLink to="/orders" activeClassName="bg-gray-200" className="p-4 w-full hover:bg-gray-200">
                Orders
              </NavLink>
              <NavLink to="/fitness" activeClassName="bg-gray-200" className="p-4 w-full hover:bg-gray-200">
                My Fitness
              </NavLink>
              <NavLink to="/qr-code" activeClassName="bg-gray-200" className="p-4 w-full hover:bg-gray-200">
                QR Code
              </NavLink>
              <NavLink to="/profile" activeClassName="bg-gray-200" className="p-4 w-full hover:bg-gray-200">
                Profile
              </NavLink>
            </div>
          </div>
        </nav>
        <div className="flex-1">
          <Switch>
            <Route exact path="/orders">
              <OrdersPage />
            </Route>
            <Route exact path="/fitness">
              <FitnessPage />
            </Route>
            <Route exact path="/qr-code">
              <QrCodePage />
            </Route>
            <Route exact path="/profile">
              <ProfilePage />
            </Route>
          </Switch>
        </div>
      </div>
    );
  };
  
  export default Dashboard;
